// src/components/ProfileTabs/AchievementProgress.js
import React from 'react';

const AchievementProgress = ({ progress }) => {
  return (
    <div className="space-y-2">
      <h3 className="text-lg font-semibold">Achievement Progress</h3>
      <div className="w-full bg-gray-200 rounded-full h-4">
        <div
          className="bg-primary h-4 rounded-full"
          style={{ width: `${progress}%` }}
        ></div>
      </div>
      <p className="text-sm text-gray-600">Complete more tasks to earn new achievements!</p>
    </div>
  );
};

export default AchievementProgress;
